import React from 'react';
import { BoxItem } from './BoxItem';

export function BoxList({ boxes, removeBox }) {
    return(
        <div className='yourBoxes'>
        <h2>Your boxes</h2>
        <ul>
            {boxes.map((box) => (
               <BoxItem key={box.id} box={box} removeBox={removeBox} /> 
            ))}
        </ul>
      </div>
    )
}
